// Variables y constantes

const nombre = "Gustavo";
let edad = 20;

console.log( nombre, edad );

edad = 21;

console.log( nombre, edad );

if ( true ) {
    const nombre = 'Peter';
    let edad = 6;

    console.log( nombre );
    console.log( edad );
}

console.log( edad );
console.log( nombre );
